Mexican Customs Brokers and US Licensed Customs Brokers, CTPAT, OLA and OEA Certification. Import & Export customs dispatch, with International Logistics Terminal in Laredo, Tx with large cargo reception capabilities for regular and oversize cargo. Door to door logistics services in between Canada, USA and Mexico. Crossdocking, warehousing, distribution, heavy load transloading services in Laredo, Tx. Importer of Record in Mexico and Hot-shot seriveces.

Servicios de Agencia Aduanal en Mexico y Customs Broker en Estados Unidos, con Certificacion en CTPAT, OLA y OEA, despacho de carga de importacion y exportacion, con Terminal Logistica en Laredo, Tx, con capacidades para recepcion de carga regular o dimensionada; Servicio de Logistica Puerta-Puerta. Crossdocking, distribucion, almacenaje y transbordos de carga pesada en Laredo, Tx. Servicio de Comercializadora de Importacion en Mexico y servicio de fletes urgentes en camiones de 3.5ton.

Contamos con cobertura de Agencias Aduanales en los principales puertos de Mexico;
